import React from 'react';
import { useParams } from 'react-router-dom';
import { Play, Clock, DollarSign, Eye } from 'lucide-react';

const VideoPlayerPage = () => {
  const { id } = useParams();

  // Mock video data - replace with actual API call
  const video = {
    id: id,
    title: 'Introduction to React Hooks',
    description: 'Learn the basics of React Hooks and how to use them effectively. This comprehensive tutorial covers useState, useEffect, and other essential hooks.',
    videoUrl: 'https://www.youtube.com/embed/dQw4w9WgXcQ', // Replace with actual video URL
    thumbnail: 'https://via.placeholder.com/800x450',
    duration: 1200, // in seconds
    reward: 0.50,
    category: 'education',
    views: 1250
  };

  const formatDuration = (seconds) => {
    const minutes = Math.floor(seconds / 60);
    const remainingSeconds = seconds % 60;
    return `${minutes}:${remainingSeconds.toString().padStart(2, '0')}`;
  };

  return (
    <div className="space-y-6">
      {/* Video Player */}
      <div className="bg-white rounded-lg shadow overflow-hidden">
        <div className="aspect-video bg-black">
          <iframe
            src={video.videoUrl}
            title={video.title}
            className="w-full h-full"
            frameBorder="0"
            allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
            allowFullScreen
          ></iframe>
        </div>
        
        <div className="p-6">
          <h1 className="text-2xl font-bold text-gray-900 mb-2">
            {video.title}
          </h1>
          
          <div className="flex items-center space-x-6 text-sm text-gray-500 mb-4">
            <div className="flex items-center">
              <Clock className="w-4 h-4 mr-1" />
              {formatDuration(video.duration)}
            </div>
            <div className="flex items-center">
              <DollarSign className="w-4 h-4 mr-1" />
              ${video.reward.toFixed(2)} reward
            </div>
            <div className="flex items-center">
              <Eye className="w-4 h-4 mr-1" />
              {video.views.toLocaleString()} views
            </div>
          </div>
          
          <p className="text-gray-600 mb-6">
            {video.description}
          </p>
          
          <div className="flex items-center justify-between">
            <div className="flex items-center space-x-4">
              <span className="px-3 py-1 bg-blue-100 text-blue-800 rounded-full text-sm font-medium">
                {video.category}
              </span>
            </div>
            
            <button className="bg-green-600 text-white px-6 py-2 rounded-lg hover:bg-green-700 transition-colors flex items-center">
              <Play className="w-4 h-4 mr-2" />
              Watch & Earn ${video.reward.toFixed(2)}
            </button>
          </div>
        </div>
      </div>

      {/* Instructions */}
      <div className="bg-blue-50 border border-blue-200 rounded-lg p-6">
        <h3 className="text-lg font-semibold text-blue-900 mb-3">
          How to earn rewards:
        </h3>
        <ul className="space-y-2 text-blue-800">
          <li className="flex items-start">
            <span className="w-2 h-2 bg-blue-600 rounded-full mt-2 mr-3 flex-shrink-0"></span>
            Watch the entire video to earn the full reward
          </li>
          <li className="flex items-start">
            <span className="w-2 h-2 bg-blue-600 rounded-full mt-2 mr-3 flex-shrink-0"></span>
            Partial rewards are given for watching at least 80% of the video
          </li>
          <li className="flex items-start">
            <span className="w-2 h-2 bg-blue-600 rounded-full mt-2 mr-3 flex-shrink-0"></span>
            You can only earn from each video once per 24 hours
          </li>
          <li className="flex items-start">
            <span className="w-2 h-2 bg-blue-600 rounded-full mt-2 mr-3 flex-shrink-0"></span>
            Rewards are automatically added to your balance
          </li>
        </ul>
      </div>
    </div>
  );
};

export default VideoPlayerPage;
